              headers, {
                  "Content-Type": "application/json"
              },
              body, JSON.stringify({
                user: 
                  username, username,
                  password, password
              })

            );





          const data = await response.json();



        } catch (error) {
            console.error(error);
        }

          };



fetchReg();

}, []);

